onse.\"],[\"Manual commission\",\"Manual commission\"],[\"Brainstorming\",\"Brainstorming\"],[\"GetStartedBrainstorming\",\"This first step is very important - think about your affiliate program.<br\\/>\\nYou should have a plan of what you want to achieve. How big commissions can you afford to provide?<br\\/>\\nWill they be attractive to affiliates compared with your competition?\\nHow to attract affiliates to join?\"],[\"Review your settings\",\"Review your settings\"],[\"GetStartedSettings\",\"Post Affiliate Pro is made in a way that it can work with the default configuration.<br\\/>However, you should check the configuration and fine tune it for your own needs.<br\\/>You can find the configuration screen under the <strong>Config & Tools menu -> Configuration<\\/strong>.<br\\/><br\\/>The detailed description of all configuration options can be found in the user's guide or knowledgebase.\"],[\"Define your commissions\",\"Define your commissions\"],[\"GetStartedCommissions\",\"One default campaign is created during the installation. You can modify it, or create your own campaigns.<br\\/><br\\/>\\nCampaigns are used to group a set of products (or only one product) that have the same commission settings.<br\\/><br\\/>\\nFor example, you can have campaign for Product1, where you'll reward your affiliates per click, and another campaign for Product2, where affiliate receives commissions per sale.<br\\/><br\\/>\\nOr you can have campaign called Low cost products, which will have 40% per sale commissions, and another campaign called Expensive products with 15% per sale commission.<br\\/><br\\/><a href='http:\\/\\/www.qualityunit.com\\/postaffiliatepro\\/services\\/integration\\/' target='_blank'>Do you need help with configuration of commissions structure?<\\/a>\"],[\"Add banners and other creatives\",\"Add banners and other creatives\"],[\"GetStartedCreatives\",\"In the <strong>Banners manager<\\/strong> you can various creatives, from text links, standard image banners to HTML, Flash and promo email banners.<br\\/>\\nEvery banner must have destination URL specified - it is the URL where the visitor is redirected after click.<br\\/><br\\/><a href='http:\\/\\/www.qualityunit.com\\/postaffiliatepro\\/services\\/webdesign\\/' target='_blank'>Do you need help with banners development?<\\/a>\"],[\"Set up emails\",\"Set up emails\"],[\"GetStartedEmails\",\"You should set up emailing functionality. This includes: <ul><li><strong>mail account<\\/strong> - how the emails are sent. You can choose either mail() function or SMTP server.<\\/li><li><strong>email templates<\\/strong> - these are templates that are used when system sends automatic emails, like after signup or after sale notifications<\\/li><li><strong>email notifications<\\/strong> - you can configure what kind of  notifications you would like to receive as merchant, and what notifications will be available for affiliates.<\\/li><\\/ul>Make sure that mail account is set up properly - try to test sending emails. Without working emails the affiliates will not receive confirmation about their signups, etc.\"],[\"Customize your affiliate signup form\",\"Customize your affiliate signup form\"],[\"GetStartedSignupForm\",\"Check the standard signup form, and customize it if you want.<br\\/><br\\/>\\nThe signup form comes with an information mini-site that contains information about the affiliate program, etc.<br\\/>You can use the mini-site, or delete it and use only signup form.<br\\/><br\\/><a href='http:\\/\\/www.qualityunit.com\\/postaffiliatepro\\/services\\/webdesign\\/' target='_blank'>Do you need help with design customization?<\\/a>\"],[\"Customize affiliate panel\",\"Customize affiliate panel\"],[\"GetStartedAffPanel\",\"Affiliate panel in Post Affiliate Pro is very flexible.<br\\/>You can configure how the menu will look like, what content you want to have there, and even write your own content or link to another pages.<br\\/><br\\/><a href='http:\\/\\/www.qualityunit.com\\/postaffiliatepro\\/services\\/webdesign\\/' target='_blank'>Do you need help with design customization?<\\/a>\"],[\"GetStartedIntegrate\",\"Integration is a way to connect the affiliate system to your current website, shopping cart or payment gateway in a way that affiliate system will be notified about referrals and purchases.<br\\/>\\nWhen notified, affiliate system registers the sale, finds referring affiliate (if any) and creates appropriate commission for him.<br\\/><br\\/>\\nIntegration usually means adding few lines of code into your pages, and it is described step-by-step  in the Integration guide for most common shopping carts and payment systems. <br\\/><br\\/><a href='http:\\/\\/www.qualityunit.com\\/postaffiliatepro\\/services\\/integration\\/' target='_blank'>Do you need help with integration?<\\/a>\"],[\"Test everything\",\"Test everything\"],[\"GetStartedTest\",\"When you have configured your campaigns, defined correct commissions, and created some banners\\/links, you should test the system.<br\\/>\\nThe best is to simulate the whole process from affiliate\\u2019s and your point of view:\\n<ol>\\n<li>Sign up as some testing affiliate \\u2013 after approval you should receive confirmation email with your password, and you should be able to log in to your affiliate panel<\\/li>\\n<li>Log in to affiliates panel, get the code for banners\\/links and put them\\u00a0onto some testing page<\\/li> \\n<li>Click on the banner and check that the click is registered<\\/li>\\n<li>After the click, try to make test sale and check that sale commission was registered in affiliate system (only for per sale or per lead commissions)<\\/li>\\n<\\/ol>\\n\\nIf you experience some problems in any of these steps, turn on <strong>Debug event logging<\\/strong> and look at <strong>Troubleshooting<\\/strong>\"],[\"Promote your affiliate program\",\"Promote your affiliate program\"],[\"GetStartedPromote\",\"After you have successfully tested integration of affiliate system with your website, everything is ready to start up promoting your new affiliate program so that you'll attract new affiliates to join it.<br\\/><br\\/>\\nIt is a must to put link to your affiliate program information or signup form to your own website. Name the link like Affiliate program, Webmasters make money, Affiliates etc. This will attract the visitors of your site and can convert them to your affiliates.<br\\/><br\\/>\\nTo reach more potential affiliates, submit your program to affiliate directories. There are tens of affiliate directories on the web, visited by thousands of experienced affiliates every day.\"],[\"Ad Channels\",\"Ad Channels\"],[\"Advanced tools\",\"Advanced tools\"],[\"Subaffiliate Sale Stats\",\"Subaffiliate Sale Stats\"],[\"ContactUs\",\"ContactUs\"],[\"Promotion tips\",\"Promotion tips\"],[\"Frequently asked questions\",\"Frequently asked questions\"],[\"Advanced tracking\",\"Advanced tracking\"],[\"DirectLinks explained\",\"DirectLinks explained\"],[\"Sale counts\",\"Sale Counts\"],[\"CTR (raw \\/ unique)\",\"CTR (raw \\/ unique)\"],[\"Design & Contents settings\",\"Design & Contents settings\"],[\"Payee info\",\"Payee info\"],[\"Copy & Paste the text above to your email editor\",\"Copy & Paste the text above to your email editor\"],[\"Show TEXT version\",\"Show TEXT version\"],[\"Checking for new version...\",\"Checking for new version...\"],[\"You are running latest version.\",\"You are running latest version.\"],[\"Latest version %s is available for download.\",\"Latest version %s is available for download.\"],[\"Branding text\",\"Branding text\"],[\"Send signup confirmation email\",\"Send signup confirmation email\"],[\"Send new password request email\",\"Send new password request email\"],[\"BannersLinksFormatDescription\",\"You can define custom formats for generating some of the creatives types\"],[\"CurrencyDescription\",\"Default currency of the affiliate system\"],[\"LanguagesDescription\",\"Manage languages, translations and date\\/t